import React from "react";
import LandingPage from "../../LandingPage";

const NavBar = () => (
  <div className="flex justify-between not-fancy-font text-white navbar_fullsize text-20 mt-20 gap-10 w-4/5">
    <div className="flex flex-col ml-8 gap-5" style={{width: "400px"}}>
      <div>Home</div>
      <div>About</div>
      <div>Projects</div>
      <div>Contact</div>
    </div>
    <div>
      <LandingPage />
    </div>
  </div>
);

export default NavBar;
